const initalState = {
    users: [],
    selecteduser: null
}

export default (state = initalState, action) => {
    switch (action.type) {
        case 'FETCH_USERS':
            return {...state, users: action.payload}
        case 'SET_SELECTED_USER':
            return {...state, }
        default:
            return state
    }
}
